# Merge two CSV Files based on row[0]:
import csv

with open('titles_latest(16thOct_02_10).csv', mode='r', newline='') as file1:
    reader = csv.reader(file1)
    headers = next(reader)
    csv_1_data = {row[1]: row for row in reader}

with open('movie_data2.csv', mode='r', newline='') as file2:
    reader = csv.reader(file2)
    next(reader)
    for row in reader:
        row_name = row[0]
        if row_name in csv_1_data:            
            csv_1_data[row_name][5] = row[1]

with open('titles_latest(16thOct_02_10).csv', mode='w', newline='') as file1:
    writer = csv.writer(file1)
    writer.writerow(headers)
    for row in csv_1_data.values():
        writer.writerow(row)

print("CSV file 1 has been updated.")
